import '../App.css'


function App() {
  return (
    <div class="main">
    <MenuBar/>
    <BrowserRouter>
      <Routes>
        <Route path="/" element={
        <>

          <Movie_board/>
        </>
        }>
        </Route>
      </Routes>
    </BrowserRouter>
    </div>
  );

}

export default App;
